Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

function 射击(){
	var itemData = _root.getItemData(_parent.手枪).data;
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);

	// 铁拳的射击读取原武器物品数据中的大部分属性，包括霰弹值，子弹速度等，方便配置不同类型的武器而非只是霰弹枪
	// 外面子弹威力的设置需要有相应的适配
	子弹属性.声音 = itemData.sound;
	子弹属性.霰弹值 = itemData.split;
	子弹属性.子弹散射度 = itemData.diffusion;
	子弹属性.发射效果 = itemData.muzzle;
	子弹属性.子弹种类 = itemData.bullet;
	子弹属性.子弹威力 = _parent.手枪威力表[_parent.手枪];
	子弹属性.子弹速度 = itemData.velocity;
	子弹属性.Z轴攻击范围 = 25;
	子弹属性.击倒率 = itemData.impact;

	_root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
   声音 = "";
   霰弹值 = 1;
   子弹散射度 = 0;
   发射效果 = "";
   子弹种类 = "近战子弹";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = 0;
   击中地图效果 = "";
   Z轴攻击范围 = 30;
   击倒率 = 1;
   击中后子弹的效果 = "空手攻击火花";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

